import React, { useState } from 'react'
import {  Paper } from '@mui/material';
import Grid from '@mui/material/Grid';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';
import SMInput from '../config/components/input';
import InputLabel from '@mui/material/InputLabel';
import SMButton from '../config/components/button';
import { sendData, sendingData } from '../config/firebase/firebasemethods';
const Form = () => {
let [allData,setallData]=useState([])

 const theme = createTheme();
  const handleSubmit = (event) => {
    event.preventDefault();
    const data = new FormData(event.currentTarget);
    console.log({
      email: data.get('email'),
      password: data.get('password'),
    });
  };

const sendfunc=()=>{
if(!allData.email){
    return alert("email is required")
}
if(!allData.password || allData.password.length < 6){
    return alert("password must required and password atleast seven characters ")
}
sendData(allData,'student').then(()=>{
    console.log("data transfer")
}).catch((err)=>{
    console.log(err)
})

console.log(allData)

}


  return (
    <Box>
      <Typography>Form</Typography>

      <ThemeProvider theme={theme}>
      <Container component="main" maxWidth="xs">
        <CssBaseline />
        <Box
          sx={{
            marginTop: 8,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
          }}
        >
         
          <Typography component="h1" variant="h5">
             form
          </Typography>
          <Box component="form" onSubmit={handleSubmit} noValidate sx={{ mt: 1 }}>
            <SMInput
              margin="normal"
              onChange={(e)=>{setSaveData({...saveData,courseName:e.target.value})}}
              required
              fullWidth
              name="password"
              label="Full Name"
              type="text"
              id="password"
              autoComplete="current-password"
            />
            <SMInput
              margin="normal"
              required
              fullWidth
              id="email"
              label="Course Name"
              name="email"
              autoComplete="email"
              autoFocus
            />
            <SMInput
              margin="normal"
              required
              fullWidth
              name="password"
              label="Categroy"
              type="text"
              id="password"
              autoComplete="current-password"
            />
            <SMInput
              margin="normal"
              required
              fullWidth
              name="password"
              type="date"
              id="password"
              autoComplete="current-password"
            />
            <Button
              type="submit"
              fullWidth
              variant="contained"
              onClick={sendfunc()}
              sx={{ mt: 3, mb: 2 }}
            >
              Submit
            </Button>

          </Box>
        </Box>
      </Container>
    </ThemeProvider>
  



         </Box>
  );
}

export default Form;
